        selector: 'page-placeholder',template:/*ion-inline-start:"C:\Deutsche-Mitte---Aktuelle-News\src\pages\placeholder\placeholder-component\placeholder.html"*/'<ion-header>\n    <ion-navbar>\n        <button ion-button menuToggle="left" icon-only>\n      <ion-icon name=\'menu\'></ion-icon>\n    </button>\n        <ion-title>10 THESEN</ion-title>\n        <ion-buttons end>\n            <button ion-button menuToggle="right" icon-only>\n                <ion-icon name=\'more\'></ion-icon>\n              </button>\n        </ion-buttons>\n    </ion-navbar>\n</ion-header>\n<ion-content padding>\n    <h2>10 THESEN zur neuen Politik für Deutschland, Europa und die Welt</h2>\n    <p>Heute sorgen wir uns alle um Frieden und Wohlergehen; in allen Lebensbereichen erfahren wir ständig Verschlechterungen. Es ist höchste Zeit für eine große Reformation von Staat und Gesellschaft.</p>\n    <h3>1. Regieren heißt dienen – nicht herrschen.</h3>\n    <p>Ehrliche Politik braucht Ethik. Wahrhaftigkeit in Regierung, Verwaltung und Medien bringt Frieden, Gerechtigkeit und Gemeinsinn. Alle Menschen sind miteinander verbunden! Direkte Demokratie ist grundlegend.</p>\n    <h3>2. Außenpolitik ist Friedenspolitik.</h3>\n    <p>Verbundenheit miteinander führt zu fairem und gerechtem Ausgleich unter allen Völkern und bringt Hilfe für alle, die Not leiden. Freundschaft mit West und Ost, ohne Ausnahmen, auch mit Russland und USA.</p>\n    <h3>3. Frieden und Wohlstand in Herkunftsländern beenden die Massenflucht.</h3>\n    <p>Wir bringen Millionen schrittweise zurück in die Heimat und helfen Nachbarländern kriegführender Regionen. Geistige Grundlage: Echte Heimatverbundenheit eint alle Völker.</p>\n    <h3>4. Sicherheit und Gerechtigkeit in Währung und Finanzen schützen Volkswirtschaften vor Raubzügen des Finanzkartells.</h3>\n    <p>Risikofrei verlassen wir den Euro – gemeinsam mit europäischen Partnern! Geldschöpfung der öffentlichen Hand, Mittelständische Finanzdienstleistungen und vielfältige gemeinschaftliche Wirtschafts- und Finanzierungsformen überwinden das Ausbeutungssystem\n        aus Zins, Zinseszins und Schuldgeld! Bargeld bleibt.</p>\n    <h3>5. Wirtschaft dient wieder allen Menschen und ihrer Selbstverwirklichung.</h3>\n    <p>Gelebte menschliche Werte erzeugen buchungstechnisch Kaufkraft.<b>Steuern runter!</b> Privatisierung stoppen! Freies Internet! Produkte sind lange haltbar, umweltfreundlich, praktisch und ungefährlich. Deutliche Lohnsteigerungen für alle! Grundeinkommen\n        fördert gemeinnützige Arbeit und löst Existenzprobleme. Großzügige Hilfen für Rentner, Behinderte und Kranke – vor allem aber: für Kinder und Familien.</p>\n    <h3>6. Ethische Politik schützt die natürlichen Grundlagen aller Lebensformen.</h3>\n    <p>Wir bringen ökologische Bau-, Land- und Forstwirtschaft, Wasser-, Boden- und Bienenschutz, gesunde Lebensmittel, dezentrale Versorgung aus neuen Energiequellen, nachhaltige Ressourcennutzung und kostenlose Kleingärten für alle.</p>\n    <h3>7. Die moderne Bildungswelt lässt alle Menschen ihre Möglichkeiten voll entfalten:</h3>\n    <p>Wahlfreiheit für neue Schul- und Lernwege, mehr und bessere KitaPlätze, deutlich kleinere Schulklassen, mehr Ausstattungen und besser ausgebildete Lehrer überall.</p>\n    <h3>8. Gesundheit ist ein Geburtsrecht.</h3>\n    <p>Kostenlose Grundversorgung für alle! Ganzheitliche Naturheilkunde statt giftiger Medikamente und Symptomkuren! Freie Therapiewahl! Alternative Solidargemeinschaften.</p>\n    <h3>9. Der ethische Staat bringt innere Sicherheit für alle.</h3>\n    <p>Unverzichtbar sind mehr und besser bezahlte Polizisten, die wir kennen. GEZ abschaffen.</p>\n    <h3>10.Volle Souveränität, Friedensvertrag und eine neue Verfassung schaffen Frieden und Freiheit.</h3>\n    <p>Viel mehr Mitsprache und Offenheit im Regierungshandeln auf allen Ebenen! Gerechte Justiz.</p>\n    <p><img src="assets/img/10ThesenFlyer.jpg" /></p>\n    <h2>Prüfen Sie: Ehrliche Politik rechnet sich! Wir haben die Vision UND den Plan.!</h2>\n</ion-content>'/*ion-inline-end:"C:\Deutsche-Mitte---Aktuelle-News\src\pages\placeholder\placeholder-component\placeholder.html"*/
